import "./card.css";
//Initializing the person card component
const Card =({person}) => {
    return (
        <div className='person relative'>
            <div className="flex items-center justify-center">
                {/* Defining the image on the card */}
                <img src={person.Poster !== "N/A" ? person.Poster: 'https://via.placeholder.com/400'} alt={person.Title}/>
            </div>
            <div className="absolute bottom-0">
                <h2>{person.Name}</h2>
            </div>
        </div>
    );
}

//Exporting the component
export default Card;
